INSERT INTO `mq_xinzi` VALUES ('30', '2011', '26', '122', '845', '1', '4300', '0', '500', '10000', '1000', '68600', '3', '武汉虽然是一个内陆城市，但生活成本一点也不低，我感觉生活压力很大！', '', '182.40.159.5', '2012-08-18 08:15:36');
INSERT INTO `mq_xinzi` VALUES ('31', '2010', '562', '118', '14', '1', '3500', '450', '300', '5000', '0', '56000', '2', '深圳如此高的消费水平，这点工资实在受不了啊！！', '', '182.40.159.5', '2012-08-18 08:16:52');
INSERT INTO `mq_xinzi` VALUES ('32', '2009', '13', '115', '845', '1', '2800', '0', '300', '3000', '0', '40200', '3', '工作压力很大，相比其它公司还行吧。不过不同的人待遇相差很远的', '', '182.40.159.5', '2012-08-18 08:18:08');
INSERT INTO `mq_xinzi` VALUES ('33', '2010', '584', '68', '687', '2', '5500', '0', '500', '10000', '0', '82000', '2', '公司制度各方面还是不错，对个人发展也有很大的好处。不过在北京消费太高了，依然看不到未来啊！', '', '182.40.159.5', '2012-08-18 08:19:37');
INSERT INTO `mq_xinzi` VALUES ('34', '2010', '554', '118', '14', '1', '6500', '0', '500', '15000', '0', '99000', '4', '每一份收入都需要付出，但是并不是每一公司都会给你对应付出的待遇，在华为工作很辛苦，但是华为对得起员工。', '', '182.40.159.5', '2012-08-18 08:20:25');
INSERT INTO `mq_xinzi` VALUES ('35', '2011', '580', '103', '845', '1', '1500', '2500', '300', '0', '0', '51600', '4', '工资浮动比较大，做销售还是要看自己的能力，做得好工资不是问题的，美团我感觉还可以，尽管我目前做得还只是一般', '', '182.40.159.5', '2012-08-18 08:21:37');
INSERT INTO `mq_xinzi` VALUES ('36', '2010', '573', '116', '803', '1', '4500', '0', '300', '0', '0', '57600', '4', '本人研究生毕业，在这里工作还行吧。不过工作压力到还不是那么大', '', '182.40.159.5', '2012-08-18 08:22:57');
INSERT INTO `mq_xinzi` VALUES ('37', '2010', '574', '144', '16', '1', '5000', '0', '500', '0', '0', '66000', '4', '工作环境比较宽松，上班也不用打卡，弹性工作制，但加班也没加班费，有免费三餐和碳酸饮料，整体感觉很舒服', '', '182.40.159.5', '2012-08-18 08:24:05');
INSERT INTO `mq_xinzi` VALUES ('38', '2011', '563', '123', '845', '2', '2000', '4000', '300', '0', '0', '75600', '3', '团购网站里拿的是提成，我写的6000当然有一些朋友是拿不到的，看个人业绩，不过我觉得在团购里干了一段时间都能拿个4/5000吧。', '', '182.40.159.5', '2012-08-18 08:26:34');
INSERT INTO `mq_xinzi` VALUES ('39', '2011', '573', '116', '874', '2', '5000', '3000', '1000', '20000', '0', '128000', '4', '公司现在效益很好，待遇不错', '', '182.40.159.5', '2012-08-18 08:27:37');
INSERT INTO `mq_xinzi` VALUES ('40', '2010', '4', '112', '216', '1', '3000', '500', '500', '40000', '20000', '108000', '4', '公司现在效益很好，待遇不错', '', '182.40.159.5', '2012-08-18 08:37:34');
INSERT INTO `mq_xinzi` VALUES ('41', '2010', '50', '68', '250', '1', '500', '3500', '0', '10000', '0', '58000', '3', '1，没有底薪（责任底薪，你要卖出多少业绩才能拿到底薪），\r\n2，没有劳动合同（签订代理合同，不属于劳动法保护的范畴，劳动部门也管不了），\r\n3，没有福利（底薪都没有，谈什么福利），', '', '182.40.160.204', '2012-08-24 23:49:05');
